export const Head = () => {
  let HeadStyles = {
    div: {
      backgroundColor: '#333333',
      height: '50px',
    },
    span: {
      color: 'gold',
      fontSize: 30,
    },
  }
  return (
    <div style={HeadStyles.div}>
      <span style={HeadStyles.span}>Welcom To Application</span>
    </div>
  )
}
